import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Login from "./page/login/login";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element=<Login></Login> />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
